import React from "react";

import Nav from "./pages/Nav";
import InfoCard from "./pages/InfoCard";
import Search from "./pages/Search";
import Repositories1 from "./pages/Repositories1";

import "./App.css";

function App() {
  return (
    <div className="App">
      <Nav />
      <InfoCard />
      <Search />
      <Repositories1 />
    </div>
  );
}

export default App;
